description:
The Baffler, est. 1988 as a punk literary magazine, is a printed and digital magazine of art and criticism that has been published irregularly over its history. In the last few years, its publishing schedule has become a little more regular.  All the included issues are on-line, but the pdfs are compiled from the original publications and are only available by subscribing normally.  Consider subscribing.
